import React from 'react';
import logo from './AWS.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} alt="logo" />
        <a>Order</a>
      </header>
    </div>
  );
}

export default App;
